--
-- Create procedure `Proc_Product_GetByFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Product_GetByFilter (IN p_LiMit int, IN p_OffSet int, IN p_ProductFilter varchar(100), IN p_CategoryName varchar(100))
BEGIN
  -- Câu lệnh lấy danh sách nhân viên theo phân trang và tìm kiếm --
  -- CreatedBy: Bien (15/03/2023 ) --
  SET @Keyword = CONCAT('%', p_ProductFilter, '%');
  SET @CategoryName = CONCAT('%', p_CategoryName, '%');
  CREATE TEMPORARY TABLE IF NOT EXISTS tbOrginal AS
  SELECT
    p.ProductId,
    p.ProductCode,
    p.FullName,
    p.Description,
    p.Quantity,
    p.Price,
    p.Image,
    p.Size,
    p.Color,
    c.CategoryName
  FROM product p
    LEFT JOIN category c
      ON p.CategoryId = c.CategoryId
  WHERE (c.CategoryName LIKE @CategoryName
  OR p_CategoryName = ''
  OR p_CategoryName IS NULL)
  AND (p.FullName LIKE @Keyword
  OR p.ProductCode LIKE @Keyword
  OR p_ProductFilter = ''
  OR p_ProductFilter IS NULL)
  ORDER BY p.ModifiedDate DESC;

  SELECT
    *
  FROM tbOrginal po
  LIMIT p_LiMit OFFSET p_OffSet;

  SELECT
    COUNT(*)
  FROM tbOrginal po;

  DROP TEMPORARY TABLE IF EXISTS tbOrginal;
END
$$

